// login.component.ts
import { Component } from '@angular/core';
import { UserService } from './user.service';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html', 
})
export class LoginComponent {
  credentials = {
    email: '',
    password: '',
  };

  constructor(private userService: UserService) { }

  login() {
    this.userService.login(this.credentials).subscribe(response => {
        console.log('Innlogging vellykket:', response);
      },
      (error) => {
        console.error('Innloggingsfeil:', error);
      }
    );
  }
}
<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8" />
    <title></title>
</head>
<body>
  <div class="container mt-5">
    <form (ngSubmit)="login()" class="needs-validation" novalidate>
      <div class="form-group">
        <label for="email">Email:</label>
        <input type="email" id="email" class="form-control bg-light" [(ngModel)]="credentials.email" name="email" required>
      </div>

      <div class="form-group">
        <label for="password">Password:</label>
        <input type="password" id="password" class="form-control bg-light" [(ngModel)]="credentials.password" name="password" required>
      </div>
      <br />
      <button type="submit" class="btn btn-primary">Log in</button>
    </form>
  </div>
</body>
</html>
